import React from "react";

function ColorBtns() {
  const colors = ["red", "sky", "yellow", "purple", "gray"];
  return (
    <div>
      <ul className="colors flex m-2 pl-2">
        {colors.map((item, ind) => (
          <li key={ind} className={`bg-${item}-500`}>
            {item}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ColorBtns;
